async function download(dialog, format = 'regular', scale = 2) {
    const messageRangeRaw = dialog.find('#message_range_input').val();
    const gridDivPadding = dialog.find('#gridDiv_padding').val();
    const anonymizeUser = dialog.find('#anonymize_user_checkbox').is(':checked');
    const anonymizeStylesheet = dialog.find('#anonymize_stylesheet_checkbox').is(':checked');

    toastr.info('Generating snapshot...', 'Please wait');

    let ranges = [];
    if (messageRangeRaw) {
        if (messageRangeRaw.includes('|')) {
            ranges = messageRangeRaw.split('|');
        } else {
            ranges = [messageRangeRaw];
        }
    } 
    else {
        ranges = [null];
    }

    if (ranges.length == 0) {
        toastr.warning(`null range`, 'Warning');
    }
    else if (ranges.length == 1) {
        const range = ranges[0]; console.log('Processing range:', range); 
        const imgBlob = await captureChatLog(format, range, anonymizeUser, anonymizeStylesheet, scale, gridDivPadding);
        if (imgBlob) {
            const link = document.createElement('a');
            link.href = URL.createObjectURL(imgBlob);
            link.download = `chatlog_${range}.png`;
            toastr.success('Chat log captured successfully!', 'Success');
            link.click();
            URL.revokeObjectURL(link.href);
        } else {
            console.warn(`captureChatLog returned null for range ${range}`);
            toastr.warning(`captureChatLog returned null for range ${range}`, 'Warning');
        }
    }
    else if (ranges.length > 1) {
        const zip = new JSZip();
        for (let i = 0; i < ranges.length; i++) {
            const range = ranges[i]; console.log('Processing range:', range); 
            const imgBlob = await captureChatLog(format, range, anonymizeUser, anonymizeStylesheet, scale, gridDivPadding);
            if (imgBlob) {
                zip.file(`chatlog_${range}.png`, imgBlob);
            } else {
                console.warn(`captureChatLog returned null for range ${range}`);
                toastr.warning(`captureChatLog returned null for range ${range}`, 'Warning');
            }
        }
        toastr.success('Chat log captured successfully!', 'Success');
        zip.generateAsync({ type: "blob" }).then(function (content) {
            const link = document.createElement('a');
            link.href = URL.createObjectURL(content);
            link.download = 'chatlogs.zip'; // ZIP file name
            link.click();
            URL.revokeObjectURL(link.href);
        }); 
    }
}

function addCaptureButton() {
    const snapshotButtonHtml = `
    <div id="snapshot_extension" class="list-group-item flex-container flexGap5" title="Take a snapshot of the chat log.">
        <div class="fa-solid fa-camera extensionsMenuExtensionButton"></div>
        <span>Snapshot</span>
    </div>`;

    $("#extensionsMenu").append(snapshotButtonHtml);

    const snapshotButton = $('#snapshot_extension');
    snapshotButton.on('click', openSnapshotMenu);
}

jQuery(function () {
    addCaptureButton();
    SlashCommandParser.addCommandObject(SlashCommand.fromProps({
        name: 'snapshot',
        callback: async (namedArgs, unnamedArgs) => {
            const format = namedArgs.format ?? 'regular';
            const messageRangeRaw = namedArgs.range ?? null;
            const gridDivPadding = namedArgs.padding ?? "5px";
            const anonymizeUser = namedArgs.anonymize === 'on' || namedArgs.anonymize === 'true';
            const anonymizeStylesheet = namedArgs.anonymizeStylesheet === 'on' || namedArgs.anonymizeStylesheet === 'true';
            const scale = namedArgs.scale ?? 2;

            // Ensure messageRangeRaw is a string, and then handle different formats.
            let ranges = [];
            if (messageRangeRaw) {
                if (messageRangeRaw.includes('|')) {
                    ranges = messageRangeRaw.split('|'); // Multiple ranges
                } else {
                    ranges = [messageRangeRaw]; // Single range
                }
            } 
            else {
                ranges = [null]; // Default to null if no range is provided
            }

            toastr.info('Generating snapshot...', 'Please wait');

            if (ranges.length == 0) {
                console.log('ranges.length:', ranges.length); 
                toastr.warning(`null range`, 'Warning');
            }
            else if (ranges.length == 1) {
                const range = ranges[0]; console.log('Processing range:', range); 
                const imgBlob = await captureChatLog(format, range, anonymizeUser, anonymizeStylesheet, scale, gridDivPadding);
                if (imgBlob) {
                    const link = document.createElement('a');
                    link.href = URL.createObjectURL(imgBlob);
                    link.download = `chatlog_${range}.png`;
                    toastr.success('Chat log captured successfully!', 'Success');
                    link.click();
                    URL.revokeObjectURL(link.href);
                } else {
                    console.warn(`captureChatLog returned null for range ${range}`);
                    toastr.warning(`captureChatLog returned null for range ${range}`, 'Warning');
                }
            }
            else if (ranges.length > 1){
                const zip = new JSZip();
                for (let i = 0; i < ranges.length; i++) {
                    const range = ranges[i]; console.log('Processing range:', range); 
                    const imgBlob = await captureChatLog(format, range, anonymizeUser, anonymizeStylesheet, scale, gridDivPadding);
                    if (imgBlob) {
                        zip.file(`chatlog_${range}.png`, imgBlob);
                    } else {
                        console.warn(`captureChatLog returned null for range ${range}`);
                        toastr.warning(`captureChatLog returned null for range ${range}`, 'Warning');
                    }
                }
                toastr.success('Chat log captured successfully!', 'Success');
                zip.generateAsync({ type: "blob" }).then(function (content) {
                    const link = document.createElement('a');
                    link.href = URL.createObjectURL(content);
                    link.download = 'chatlogs.zip'; // ZIP file name
                    link.click();
                    URL.revokeObjectURL(link.href);
                }); 
            }
        },
        aliases: ['snapshot'],
        returns: 'nothing (captures an image of the chat log)',
        namedArgumentList: [
            SlashCommandNamedArgument.fromProps({
                name: 'format',
                description: 'the format of the snapshot',
                typeList: ARGUMENT_TYPE.STRING,
                defaultValue: 'regular',
                enumList: ['regular', 'grid'],
            }),
            SlashCommandNamedArgument.fromProps({
                name: 'range',
                description: 'the range of messages to include (e.g., "1-10")',
                typeList: ARGUMENT_TYPE.STRING,
                defaultValue: null,
            }),
            SlashCommandNamedArgument.fromProps({
                name: 'padding',
                description: 'the padding of grid (e.g., "10px")',
                typeList: ARGUMENT_TYPE.STRING,
                defaultValue: "5px",
            }),
            SlashCommandNamedArgument.fromProps({
                name: 'anonymize',
                description: 'whether to anonymize user data',
                typeList: ARGUMENT_TYPE.BOOLEAN,
                defaultValue: 'false',
                enumList: ['true', 'false'],
            }),
            SlashCommandNamedArgument.fromProps({
                name: 'anonymizeStylesheet',
                description: 'whether to apply a default stylesheet',
                typeList: ARGUMENT_TYPE.BOOLEAN,
                defaultValue: 'false',
                enumList: ['true', 'false'],
            }),
            SlashCommandNamedArgument.fromProps({
                name: 'scale',
                description: 'the scale factor for the output image (e.g., 1 for 100%, 2 for 200%)',
                typeList: ARGUMENT_TYPE.NUMBER,
                defaultValue: 2,
            }),
        ],
        unnamedArgumentList: [],
        helpString: `
            <div>
                Captures a snapshot of the chat log, either in full or for specific message ranges.
            </div>
            <div>
                <strong>Example:</strong>
                <ul>
                    <li>
                        <pre><code class="language-stscript">/snapshot</code></pre>
                        Captures the entire chat log in regular format with default settings.
                    </li>
                    <li>
                        <pre><code class="language-stscript">/snapshot range="0-11|12-17|18-21|22-41|42-45" padding="5px 5px 0px 5px"</code></pre>
                        Captures five snapshots for message ranges 0-11, 12-17, 18-21, 22-41, and 42-45, creating a zip archive. Note the use of quotes when the range contains the pipe character.
                    </li>
                    <li>
                        <pre><code class="language-stscript">/snapshot range=0-11 padding="5px 10px"</code></pre>
                        Captures a single snapshot for message range 0-11. No quotes are needed.
                    </li>
                    <li>
                        <pre><code class="language-stscript">/snapshot range=11 padding="5px"</code></pre>
                        captures a single snapshot for message range 11. No quotes are needed.
                    </li>
                </ul>
            </div>
        `,
    }));
});
